import React from 'react';
import style from './TripList.module.css';
import tripListData from './TripListData.js'

import Container from '@material-ui/core/Container';
import Paper from '@material-ui/core/Paper';

import ScrollDialog from './MoreDetailsButton'

export default function CenteredGrid() {
  return (
    <>  
      {tripListData.map(item => (
        <Paper elevation={3} className={style.paper}>
          <Container maxWidth="sm" className={style.cityNameContainer}> 
            <div>{item.city} </div>
          </Container>
          <Container maxWidth="sm" className={style.descriptionContainer}> 
            <div>For {item.numberOfPeople}, during {item.tripLength}, in the {item.seasonTime}.</div>
          </Container>
          <ScrollDialog className={style.moreDetailsButton} name={item.name} city={item.city} numberOfPeople={item.numberOfPeople} tripLengt={item.tripLengt} seasonTime={item.seasonTime} price={item.price} description={item.description} />
        </Paper>
      ))}
    </>
  );
}
